import React from 'react'
import './radio.css'
// eslint-disable-next-line
var bcrypt = require("bcryptjs")
function checkbox() {
    var x = document.getElementById("myCheck").checked

    if (x === true) {
        localStorage.setItem("intro", "no")
    } else {
        // do nothing
    }
}

class top extends React.Component {

    state = {
        href: ''
    }

    render() {
        return (
            <div>
                <h1>Hello!</h1> <br /> <h2>welcome to the secret world of PADAH (Professional Agency of Detectives And Hackers).
            <br /> Now you will be directed to your Home Page.
            <br /></h2>

                <section className="Show-again">
                    <input id='one' type='checkbox' />
                    <label for='one'>
                        Don't Show Again
                    </label>
                </section>

                <section className="button">

                    <a href='/home' class="animated-button1" onClick={checkbox}>
                        <span></span>
                        <span></span>
                        <span></span>
                        <span></span>
                        Go to home
                </a>
                </section>
            </div>
        )
    }
}

export default top;
